<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <script>
        document.addEventListener('DOMContentLoaded',function()
        {
            const divs = document.querySelectorAll('div')
            divs.forEach(
                function(mydiv,myindex)
                {   
                    let red = 0
                    let green =0
                    let blue = 0
                    if(myindex<(255*1))
                    {
                        red =255
                        green = myindex
                    }
                    else if(myindex<(255*2)){
                        red = 255 - (myindex%255)
                        green = 255
                    }
                    else if(myindex<(255*3)){
                        blue = (myindex%255)
                        green = 255
                    }
                    
                    else if(myindex<(255*4)){
                        blue = 255
                        green = 255-(myindex%255)
                    }
                    
                    else if(myindex<(255*5)){
                        blue = 255
                        red = myindex%255
                    }
                    
                    else if(myindex<(255*6)){
                        red = 255
                        blue = 255-(myindex%255)
                    }
                    mydiv.style.height ='1px'
                    mydiv.style.backgroundColor = `rgb(${red},${green},${blue})`
                }
            )
        })
    </script>
